    <p><strong>Intensity</strong> is generally greater in areas near the epicenter; however, it is possible that two nearby areas may experience different intensities. Factors that affect or control the intensity or shaking of an earthquake include the depth of the earthquake, distance from fault rupture, ground material, and building construction.</p>
